    [],nt"num_tags": 0,nt"name": "partial-pressure-or-fugacity-of-carbon-dioxide-salinity-and-other-variables-collected-from-time07f28",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0100074 includes chemical,
    physical and time series data collected from MOORINGS in the North Pacific Ocean
    from 2010-06-15 to 2010-06-15. These data include AIR-SEA DIFFERENCE - PARTIAL PRESSURE
    (OR FUGACITY) OF CARBON DIOXIDE, CARBON DIOXIDE - AIR, OXYGEN - PERCENT SATURATION,
    Partial pressure (or fugacity) of carbon dioxide, SALINITY and SEA SURFACE TEMPERATURE.
    The instruments used to collect these data include Bubble type equilibrator for
    autonomous carbon dioxide (CO2) measurement and Carbon dioxide (CO2) gas analyzer.nnThese
    data were collected by Adrienne Sutton, Christopher Sabine and Stacy Maenner of
    US DOC; NOAA; OAR; Pacific Marine Environmental Laboratory as part of the Mooring
    Papa_145W_50N data set. CDIAC assigned the following cruise ID(s) to this data set:
    PAPA20070608.nnThe Global CO2 Time-series and Moorings Project involves international
    groups from 18 countries who have mounted sensors on moored buoys to provide high
